import React, { Component } from "react";

import "./Tutorial.css";

export default class ClearSearch extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="tutorial">
        <h3 className="title">Clearing the Simulated Search</h3>
        <h6 className="bold-paragraph">
          Select the "Clear Search" button to clear the simulated search.
        </h6>
        <button
          className="button-clear"
          onClick={() => {
            this.cancelTimeouts();
            this.resetGridStyles(grid);
            this.resetPath();
          }}
        ></button>
        <img
          className="tutorial-image"
          src={require("./../../gifs/clear.gif")}
        ></img>
        <div className="page">8/12</div>
        <button
          className="next"
          onClick={() => {
            this.props.incrementPage();
          }}
        >
          Next
        </button>
        <button
          className="previous"
          onClick={() => {
            this.props.decrementPage();
          }}
        >
          Previous
        </button>
        <button
          className="skip"
          onClick={() => {
            this.props.skip();
          }}
        >
          Skip
        </button>
      </div>
    );
  }
}
